"247185":{"id":"247185","name":"Desenhos Animados do Velho Testamento","slug":"desenhos-animados-do-velho-testamento","original_title":"Animated Stories from the Bible","overview":"A série é uma coleção educacional não-sectária de histórias da Bíblia Hebraica, destinada a promover valores positivos e traços de caráter em jovens.","first_air_date":"1992-06-10","episode_run_time":0,"vote_average":8.4,"number_of_seasons":1,"number_of_episodes":12,"created_by":["Richard Rich"],"production_companies":[],"genres":[],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/4cGUl9eyvmwRk3jbZTRRhkyeZ70.jpg","poster_path":"https://image.tmdb.org/t/p/original/rbXgq5U0dT0qdM50aGPLFQkpe6r.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Desenhos Animados do Velho Testamento","poster_path":"https://image.tmdb.org/t/p/original/rbXgq5U0dT0qdM50aGPLFQkpe6r.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/rbXgq5U0dT0qdM50aGPLFQkpe6r.jpg","air_date":"1992-06-10","episode_count":12,"overview":"Desenhos Animados do Velho Testamento é uma série americana de desenhos animados produzido pela Nest Family Entertainment em associação com a Rich Animation Studios. Trata-se de uma coleção histórias da Bíblia Hebraica. Essas histórias são um relato das histórias bíblicas do Antigo Testamento.","vote_average":0,"episodes":{"1":{"name":"Abraão e Isaac","overview":"Abrão morava com sua família na Mesopotânia. Deus viu em Abraão um homem justo, correto e bondoso e fez-lhe promessas, dizendo que ele teria uma grande descendência e por ele seriam abençoadas todas as famílias da terra. Obediente e temente, Abrão foi honrado por Deus, como um pai de um povo numeroso. Assista e se emocione com essa bela história.","air_date":"1992-06-10","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/9XgSaQ3t0iSsiIJ5mX6N3tGHRin.jpg","vote_average":0},"2":{"name":"Samuel o Menino Profeta","overview":"Havia em Israel uma mulher estéril chamada Ana cujo maior desejo era ter um filho. Um dia, ao ir ao templo, ela pediu ao Senhor que lhe desse um bebê, e o prometeu que ao nascer, o entregaria para viver no templo, servindo por toda a vida ao Senhor. A criança era Samuel. Por sempre ter sido obediente, Samuel é escolhido por Deus como sacerdote, juiz e profeta do povo de Israel.","air_date":"1993-03-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/phVq1D9sXfOjLyPh4IyYTA8mexW.jpg","vote_average":0},"3":{"name":"José do Egito","overview":"O faraó teve um sonho estranho e convocou os magos para interpretá-lo. Ninguém conseguiu. Ficou sabendo de José, um hebreu de Canaã levado ao Egito como escravo e que se encontrava preso. Após relutar, o faraó resolve dar uma chance a José. Ouvindo as palavras do Senhor, o ex-escravo interpreta o sonho e conquista a confiança do faraó. Era o início de uma fase para o Egito e para José.","air_date":"1992-06-17","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/ycspGokbp4hVcJicZ3kd7kpoahR.jpg","vote_average":0},"4":{"name":"Elias","overview":"A multidão silencia com as palavras do grande profeta Elias. Relâmpagos e trovões ecoam no Monte Carmelo. E Elias continua: Até quando vocês ficarão indecisos? Se o. Senhor é Deus siga-o! Se Baal é Deus, então sigam a Baal! Através da coragem de Elias, Deus proporciona ao povo de Israel, diante dos olhos dos sacerdotes de Baal, uma das maiores manifestações de seu poder.","air_date":"1993-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/wV20EQ4Pb6VyeXqs9Jf8JNLUIQj.jpg","vote_average":0},"5":{"name":"Daniel","overview":"O rei da Babilônia convoca Daniel para interpretar um sonho. Ao contrário dos magos reais, ele simplesmente repetiu o que ouviu do Senhor. Furioso , o rei proíbe as orações, sabendo que desta forma puniria Daniel. Mas, como servo de Deus ele não poderia deixar de rezar e acaba sendo castigado, ele é colocado na cova dos leões e graças às suas orações, consegue sair de lá.","air_date":"1993-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/Y8UFiTj7Yseoa3yZbDWC46Vhqt.jpg","vote_average":0},"6":{"name":"Ester","overview":"O que você faria se tivesse que arriscar a própria vida para salvar a vida de outros? Este foi o grande dilema que a jovem rainha Ester teve que enfrentar. Toda intriga, perigo e traição que envolvia o palácio real da Pérsia, estão bem representados nesta história dramática e inspiradora.","air_date":"1993-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/xzIIUcBEKWpzgpvkeust6HCRLVP.jpg","vote_average":0},"7":{"name":"Moises: Do Nascimento ao Chamado De Deus","overview":"O rei do Egito foi avisado da profecia de que o messias chegaria. Para evitar que o inimigo sobrevivesse, ele ordenou que matassem todos os bebês do sexo masculino. No desespero de salvar seu filho, a mãe de Moisés o coloca numa cesta rio abaixo. Quando uma princesa encontra aquela pobre criança, decide pega-la e cuidar dela. Assim foi salva a vida do principal líder de Israel.","air_date":"1993-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/n6VK7aFEhNcu7hKybKDhbn8EcNk.jpg","vote_average":0},"8":{"name":"Eliseu","overview":"Elias está prestes a encerrar seu ministério como profeta em Israel. Eliseu que será seu sucessor, o acompanha em seus últimos passos. De repente, Elias é levado ao céu numa carruagem de fogo. Lá do alto ele joga seu manto para Eliseu, passando então, a ele a responsabilidade de conduzir espiritualmente aquele povo. Eliseu se torna um valioso instrumento nas mãos de Deus.","air_date":"1994-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/mUQDpOcL5OiLC9mEcFAmQTMW6XV.jpg","vote_average":0},"9":{"name":"A Historia de Ruth","overview":"Ruth fica viúva e decide voltar a Belém com sua sogra Noemi, para cuidar dela. Ali, trabalha duro para garantir a sobrevivência das duas e conhece Boás, dono das terras onde colhe trigo. Os dois acabam se apaixonando e depois de algum tempo eles se casam. Deles, nasce Obed, que foi pai de Jessé que foi pai de Dabid, que uniu Israel dando início a uma nova era.","air_date":"1994-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/qcHxpk2WohWqt2tY6f17ML32osn.jpg","vote_average":0},"10":{"name":"David e Golias","overview":"David, um jovem pastor que gosta de poesia e música, parece um candidato improvável para salvar seu país da ruína. Mas, quando Golias desafia Israel e blasfema contra Deus, o jovem David entra em ação, ganhando o seu lugar como um dos maiores heróis da Bíblia. Esta história dramática irá transportá-lo para o campo de batalha e você verá Deus em ação através de um garoto humilde.","air_date":"1995-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/mFXLnV7FEQjaRilUzWNnTHV8rJT.jpg","vote_average":0},"11":{"name":"A Reunião de José","overview":"Há 21 anos José foi vendido por seus irmãos aos egípcios, como escravo, e acabou se tornando Governador do Egito. Mas sua família acredita que está morto. Agora, uma grave escassez de alimentos leva seus dez irmãos mais velhos a procurarem ajuda no Egito.José decide dar-lhes uma lição. Depois de passarem pelo teste, ele perdoa seus irmãos e volta para casa visitar seu velho pai.","air_date":"1995-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/oMENtC7Rb2PtoyWSoXVFWT5rJGx.jpg","vote_average":0},"12":{"name":"Salomão","overview":"O rei Davi era conhecido por sua sabedoria. No leito de morte, ele unge seu filho mais novo, Salomão, para ser o rei de Israel. Adonias irmão mais velho tenta arrancar a coroa. Porém, ele mostra sabedoria e coragem quando confronta seu irmão, dizendo: Se eu for rei, não viverei com medo. Mate-me agora se esse for o seu plano, ou então vá para casa e nunca mais desafie a vontade de Deus.","air_date":"1995-06-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/lbGHnCdzWt5EIruWgDQMB9KNL86.jpg","vote_average":0}}}}},
